import React from "react";
import "./Company.css";
import img1 from "./image 26.png";
import img2 from "./busyhub.png";
import img3 from "./image 27.png";
import img4 from "./image 30.png";
import img5 from "./image 24.png";

function Company() {
  return (
    <div>
      <div className="sec6-container">
        <div>
          <img src={img1} alt="" />
        </div>
        <div>
          <img src={img2} alt="" />
        </div>
        <div>
          <img src={img3} alt="" />
        </div>
        <div>
          <img src={img4} alt="" />
        </div>
        <div>
          <img src={img5} alt="" />
        </div>
        <div>
          <img src={img6} alt="" />
        </div>
      </div>
    </div>
  );
}

export default Company;
